import React from 'react';
import ReturnAuthoriZAtion from './Authorization';
import { useNavigate } from 'react-router-dom';
import { gsap, Expo } from 'gsap';


// Return Authorization
export default function AuthoRizAtion() {

 const navigation = useNavigate();

 React.useEffect(() => {
  const data = window.localStorage.getItem('ACTIVE');
  JSON.parse(data) != true && navigation('/');

  window.setTimeout(() => {
   gsap.to('.App-loading-blank', .1, { delay: .2, x: '-1000%', opacity: 0, ease: Expo.easeIn })
  }, 100);

 }, []);

 return (
  <>
   <div className='App-loading-blank'></div>
   <ReturnAuthoriZAtion />
  </>
 );
};
